import './App.css';
import Form from './components/Form';
import TodoItem from './components/TodoItem';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <h1>Todo <span>App</span></h1>
      <Form />
      <TodoItem />
      <Footer />
    </div>
  );
}

export default App;
